    constructor(props){
        super(props)
        this.state = {
            search:""
        }
    }
    render() {
        return (
            <div className="search">
                <input name="search" value={this.state.search} placeholder="Search Film"/>
                <p><FontAwesomeIcon icon={['fab', 'apple']} />
    <FontAwesomeIcon icon={['fab', 'microsoft']} />
    <FontAwesomeIcon icon={['fab', 'google']} /></p>
            </div>
        );
    }
}

export default SearchBar;
